class Solution:
    def minimalKSum(self, nums: list[int], k: int) -> int:
        n_dict = {n:True for n in nums}
        g_dict = {}
        for i in range(1, max(nums) + 1):
            if i in n_dict:
                pass
            else:
                g_dict[i] = True
        
        total = 0
        if len(g_dict) >= k:
            sorted_list = sorted(g_dict.keys())
            for i in range(k):
                total += sorted_list[i]
        else:
            diff = k - len(g_dict)
            max_nums = max(nums)
            total = sum(g_dict.keys())
            for i in range(max_nums + 1, max_nums + diff + 1):
                total += i
        
        return total

